import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
width: 250px;
height: 350px;
background: #2e517d;
position: relative;
left: 50%;
top: 50%;
transform: translate(-50%,-50%);
perspective: 1000px;
`;

const Cover=styled.div`
width: 210px;
height: 100%;
position: absolute;
left: 40px;
background-color: #345b8c;
transform: rotateY('20deg');


`;
const FoldingCard = () => {
    return (
       <Container>
           <Cover>

           </Cover>
       </Container>
    )
}

export default FoldingCard
